import './App.css';
import {BrowserRouter, Routes, Route } from 'react-router-dom';
import Navbar from './componets/Navbar/Navbar';
import Shop from './pages/Shop'
import ShopCatagory from './pages/ShopCatagory';
import Product from './pages/Product';
import Cart from './pages/Cart';
import Loginsignup from './pages/loginsignup';
import mensbanner from './componets/assets/banner_mens.png'
import kidssbanner from './componets/assets/banner_kids.png'
import womensbanner from './componets/assets/banner_women.png'
import Footer from './componets/Footer/Footer';

function App() {
  return (
    <div>
      <BrowserRouter>
      <Navbar/>
      <Routes>
        <Route path='/' element={<Shop/>}/>
     <Route path='/Mens' element={<ShopCatagory  banner ={mensbanner} category="Mens"/>}/>
     <Route path='/Womens' element={<ShopCatagory banner={womensbanner} category="Womens"/>}/>
     <Route path='/Kids' element={<ShopCatagory banner={kidssbanner} category="Kids"/>}/>
     <Route path='/Product' element={<Product/>}/>
     <Route path='/ProductID' element={<Product/>}/>
      </Routes>
      <Routes>
           <Route path='/Cart' element={<Cart/>}/>
      <Route path='/Login' element={<Loginsignup/>}/>
      </Routes>
      <Footer/>
      </BrowserRouter>



    </div>
  );
}

export default App;
